// import ExpenseItem from './components/ExpenseItem';

import ExpenseItem from "./components/ExpenseItem.jsx";

const comp = [
  {
    title : 'Car Insurance',
    amount: '$2829382',
    date: new Date(2023, 1, 2),
  }
]

function App() {
  return (
    <div>
      <h1>Let's get started!</h1>
      <ExpenseItem 
        title={comp[0].title}
        amount={comp[0].amount}
        date={comp[0].date}
      />
    </div>
  );
}

export default App;
